syntax = "proto3";

package br.com.via.microservicechangeit.adapters.grpc;

option java_multiple_files = true;
option java_package = "br.com.via.microservicechangeit.adapters.grpc";

// The service definition
// O nome do serviço será exposto no servidor grpc como um endpoint
service CustomerService {
  // Create a customer
  rpc createCustomerData (CreateCustomerRequestDtoProto) returns (CreateCustomerResponseDtoProto) {
  }

  // Get a customer
  rpc getUniqueCustomerData (GetCustomerRequestDtoProto) returns (GetCustomerResponseDtoProto) {

  }
}

message CreateCustomerRequestDtoProto {
  string name = 1;
  string birthday = 2;
}
message CreateCustomerResponseDtoProto {
  string id = 1;
}

message GetCustomerRequestDtoProto {
  string id = 1;
}
message GetCustomerResponseDtoProto {
  string id = 1;
  string name = 2;
  string birthday = 3;
}

syntax = "proto3";

package br.com.via.microservicechangeit.adapters.grpc.external_service_simulation;

option java_multiple_files = true;
option java_package = "br.com.via.microservicechangeit.adapters.grpc.external_service_simulation";

// The service definition.
service AnExternalService {
  rpc getBrazilianFederalRevenueByName (BrazilianFederalRevenueRequestDtoProto) returns (BrazilianFederalRevenueResponseDtoProto) {
  }
}

message BrazilianFederalRevenueRequestDtoProto {
  string name = 1;
}
message BrazilianFederalRevenueResponseDtoProto {
  string motherName = 1;
  bool isDeceased = 2;
  string dateOfLastDocumentUpdate = 3;
}
